- input: "TEXT\x1CC00199711\x1C.TEXT\x1C\x1CF3XA\x1CIn response to a letter received
    from the FEC dated February 11, 2011, noting two items on the 30 Day Post-General
    Report:  Item 1:  Schedule B discloses a $2,000 contribution to Volunteers for
    Shimkus which appears to exceed the contribution limits when combined with the
    $3,000 contribution of an affiliated PAC, Blue Shield of California.  The Volunteers
    for Shimkus committee refunded the $3,000 to the Blue Shield of California PAC,
    and reported the refund on its Form 3 Post-General report, which was filed 12/2/10.
    \ Due to a clerical error on the refund check, it was reissued in late December,
    and should be reflected on the next Blue Shield of California FEC filing.  While
    efforts were made to coordinate the contribution to Volunteers for Shimkus prior
    to delivering it, an oversight occurred, and it is our understanding that our
    affiliated PAC has taken the required action to correct the situation.                       Item
    2:  Designation of a contribution to People for Ben committee for the Primary
    Election after the date of the primary election.  Due to a clerical error, the
    contribution was incorrectly designated for the Primary Election on the report.
    \ This contribution should have been designated and reported for the General 2010
    election.  The report has been amended to reflect the proper designation.  A copy
    of the check reflecting the correct designation is on file if needed.\n"
